import styled, { ThemeProvider } from "styled-components";

function HomeSpace() {
  return (
    <ThemeProvider theme={THEMES["light"]}>
      <div>commINUty</div>
      <div>
        당신의 인천대학교 생활을 도와줄
        <br />
        위치기반 통합 서비스
      </div>
      <button>로그인</button>
      <div>아직 회원이 아니신가요?</div>
    </ThemeProvider>
  );
}

export default HomeSpace;
